/**
 * Data that you want to pass into your request. Based on
 * fetch RequestInit.
 */
export interface IFetchOptions extends RequestInit {
    /**
     * Parameters added to the url
     */
    params?: object;
    /**
     * The headers to attach
     */
    headers?: HeadersInit | any;
    /**
     * Parameters added as body
     */
    [key: string]: any;
}
